import React, {useState, useEffect} from 'react'

function Webapp(){

  useEffect(() => {
    const Init = {
      method: 'GET',
      headers: {
        'AccountKey': 'b5NRmQ28QUSAE/qVP8jx2g==',
      },
      credentials: 'include'
    }
    const res = fetch('http://datamall2.mytransport.sg/ltaodataservice/BusArrivalv2?BusStopCode=66211', Init)
    .catch(console.log)
    console.log(res)
  })

  return(
    <div className="section middle-container">
      <h1>Nextbus</h1>
    </div>
  )
}

export default Webapp
